using namespace std;

namespace __MATRIX__ {
	using row = vector<float>;
	using matrix = vector<row>;

	matrix operator+ (const matrix& a, const matrix& b) {
		matrix ret = a;
		for (int i = 0; i < a.size(); i++) for (int j = 0; j < a[0].size(); j++)
			ret[i][j] += b[i][j];
		return ret;
	}

	matrix operator- (const matrix& a, const matrix& b) {
		matrix ret = a;
		for (int i = 0; i < a.size(); i++) for (int j = 0; j < a[0].size(); j++)
			ret[i][j] -= b[i][j];
		return ret;
	}

	matrix operator* (const matrix& a, const matrix& b) {
		matrix ret = a;
		for (int i = 0; i < a.size(); i++) for (int j = 0; j < a[0].size(); j++)
			ret[i][j] *= b[i][j];
		return ret;
	}

	matrix operator+ (float a, const matrix& b) {
		matrix ret = b;
		for (int i = 0; i < b.size(); i++) for (int j = 0; j < b[0].size(); j++)
			ret[i][j] += a;
		return ret;
	}

	matrix operator- (float a, const matrix& b) {
		matrix ret = b;
		for (int i = 0; i < b.size(); i++) for (int j = 0; j < b[0].size(); j++)
			ret[i][j] -= a;
		return ret;
	}

	matrix operator* (float a, const matrix& b) {
		matrix ret = b;
		for (int i = 0; i < b.size(); i++) for (int j = 0; j < b[0].size(); j++)
			ret[i][j] *= a;
		return ret;
	}

	matrix dot(const matrix& a, const matrix& b) {
		matrix ret(a.size(), row(b[0].size()));
		for (int i = 0; i < ret.size(); i++) for (int j = 0; j < ret[0].size(); j++)
			for (int k = 0; k < a[0].size(); k++) ret[i][j] += a[i][k] * b[k][j];
		return ret;
	}

	matrix transpose(const matrix& a) {
		matrix ret(a[0].size(), row(a.size()));
		for (int i = 0; i < a.size(); i++) for (int j = 0; j < a[0].size(); j++)
			ret[j][i] = a[i][j];
		return ret;
	}
}
using namespace __MATRIX__;

struct ReLU {
	float operator() (float x) {
		return max<float>(0, x);
	}

	matrix operator() (matrix x) {
		matrix ret = x;
		for (auto& i : ret) for (auto& j : i)
			j = (*this)(j);
		return ret;
	}

	matrix deriv(matrix x) {
		matrix ret = x;
		for (auto& i : ret) for (auto& j : i)
			j = j > 0;
		return ret;
	}
};

struct Network {
	vector<int> shape;
	vector<matrix> w, b;
	ReLU activation_f{};

	Network(vector<int> shape) : shape(shape) {
		for (int i = 1; i < shape.size(); i++) {
			w.push_back(matrix(shape[i], row(shape[i - 1])));
			b.push_back(matrix(shape[i], row(1)));
		}
	}

	matrix forward(matrix x) {
		auto ret = x;
		for (int i = 0; i < w.size(); i++)
			ret = activation_f(dot(w[i], ret) + b[i]);
		return ret;
	}

	int Calc(matrix x) {
		auto res = forward(x);
		float mx = res[0][0]; int idx = 0;
		for (int i = 1; i < 10; i++) {
			if (mx >= res[i][0]) continue;
			mx = res[i][0]; idx = i;
		}
		return idx;
	}
};

